'''Goblins''' are one of the most common, low-[[Combat level|level]] [[monsters]] found around [[Gielinor]]. They are a very popular monster killed by low-level players training their [[combat]] [[skills]].

Though lacking intelligence and strength, goblins make up for this with their overwhelming numbers. Goblins are followers of the god [[Bandos]], who they refer to as the "Big High War God". Goblins are frequently at war with the other races of [[Gielinor]], in particular dwarves and gnomes.

Goblins are often one of the first monsters a player will encounter in ''[[Old School RuneScape|RuneScape]]'', as they inhabit much of the area around [[Lumbridge]].

The single armed goblin with a blue mail (as indicated in the [[#Gallery|gallery]] below) is the only aggressive goblin found anywhere, other than the [[Goblin (GWD)|variants]] found in the [[God Wars Dungeon]]s. Whenever a player is standing anywhere inside the [[Goblin Cave]] (even when outside the goblin's direct surroundings), it will yell {{RSChat|Halt intruder!}}, within regular time intervals. This goblin has a wander range spanning almost the entire goblin cave, so it may attack players practically anywhere inside these caves.

